using System;
using System.Linq;
using Shouldly;
using System.Threading.Tasks;
using Volo.Abp.Domain.Repositories;
using Volo.Abp.Modularity;
using Xunit;

namespace HRManagementSoftware.LeaveRequests
{
    public abstract class LeaveRequestsAppServiceTests<TStartupModule> : HRManagementSoftwareApplicationTestBase<TStartupModule>
        where TStartupModule : IAbpModule
    {
        private readonly ILeaveRequestsAppService _leaveRequestsAppService;
        private readonly IRepository<LeaveRequest, Guid> _leaveRequestRepository;

        public LeaveRequestsAppServiceTests()
        {
            _leaveRequestsAppService = GetRequiredService<ILeaveRequestsAppService>();
            _leaveRequestRepository = GetRequiredService<IRepository<LeaveRequest, Guid>>();
        }

        [Fact]
        public async Task GetListAsync()
        {
            // Act
            var result = await _leaveRequestsAppService.GetListAsync(new GetLeaveRequestsInput());

            // Assert
            result.TotalCount.ShouldBe(2);
            result.Items.Count.ShouldBe(2);
            result.Items.Any(x => x.LeaveRequest.Id == Guid.Parse("7df52f80-dda1-44c8-925d-7924c9f6a042")).ShouldBe(true);
            result.Items.Any(x => x.LeaveRequest.Id == Guid.Parse("fe0c85d4-7232-4ed4-9dac-18a6ac611103")).ShouldBe(true);
        }

        [Fact]
        public async Task GetAsync()
        {
            // Act
            var result = await _leaveRequestsAppService.GetAsync(Guid.Parse("7df52f80-dda1-44c8-925d-7924c9f6a042"));

            // Assert
            result.ShouldNotBeNull();
            result.Id.ShouldBe(Guid.Parse("7df52f80-dda1-44c8-925d-7924c9f6a042"));
        }

        [Fact]
        public async Task CreateAsync()
        {
            // Arrange
            var input = new LeaveRequestCreateDto
            {
                LeaveType = default,
                LeaveStatus = default,
                StartDate = new DateTime(2004, 7, 17),
                EndDate = new DateTime(2015, 11, 15),
                Reason = "",
                RequestDate = new DateTime(2016, 9, 15)
            };

            // Act
            var serviceResult = await _leaveRequestsAppService.CreateAsync(input);

            // Assert
            var result = await _leaveRequestRepository.FindAsync(c => c.Id == serviceResult.Id);

            result.ShouldNotBe(null);
            result.LeaveType.ShouldBe(default);
            result.LeaveStatus.ShouldBe(default);
            result.StartDate.ShouldBe(new DateTime(2004, 7, 17));
            result.EndDate.ShouldBe(new DateTime(2015, 11, 15));
            result.Reason.ShouldBe("");
            result.RequestDate.ShouldBe(new DateTime(2016, 9, 15));
        }

        [Fact]
        public async Task UpdateAsync()
        {
            // Arrange
            var input = new LeaveRequestUpdateDto()
            {
                LeaveType = default,
                LeaveStatus = default,
                StartDate = new DateTime(2016, 11, 19),
                EndDate = new DateTime(2008, 3, 16),
                Reason = "",
                RequestDate = new DateTime(2016, 9, 26)
            };

            // Act
            var serviceResult = await _leaveRequestsAppService.UpdateAsync(Guid.Parse("7df52f80-dda1-44c8-925d-7924c9f6a042"), input);

            // Assert
            var result = await _leaveRequestRepository.FindAsync(c => c.Id == serviceResult.Id);

            result.ShouldNotBe(null);
            result.LeaveType.ShouldBe(default);
            result.LeaveStatus.ShouldBe(default);
            result.StartDate.ShouldBe(new DateTime(2016, 11, 19));
            result.EndDate.ShouldBe(new DateTime(2008, 3, 16));
            result.Reason.ShouldBe("");
            result.RequestDate.ShouldBe(new DateTime(2016, 9, 26));
        }

        [Fact]
        public async Task DeleteAsync()
        {
            // Act
            await _leaveRequestsAppService.DeleteAsync(Guid.Parse("7df52f80-dda1-44c8-925d-7924c9f6a042"));

            // Assert
            var result = await _leaveRequestRepository.FindAsync(c => c.Id == Guid.Parse("7df52f80-dda1-44c8-925d-7924c9f6a042"));

            result.ShouldBeNull();
        }
    }
}